import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Profile = () => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [form, setForm] = useState({ firstName: '', lastName: '', email: '', phone: '', street: '', barangay: '', city: '', province: '', zipCode: '', country: 'Philippines' });
  const [saving, setSaving] = useState(false);
  const [success, setSuccess] = useState(null);
  const [addresses, setAddresses] = useState([{ street: '', barangay: '', city: '', province: '', zipCode: '', country: 'Philippines' }]);

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        setLoading(true);
        const res = await axios.get('/api/auth/profile');
        setUser(res.data.data.user);
        setAddresses(res.data.data.user.addresses || [{ street: '', barangay: '', city: '', province: '', zipCode: '', country: 'Philippines' }]);
        setForm({
          firstName: res.data.data.user.firstName || '',
          lastName: res.data.data.user.lastName || '',
          email: res.data.data.user.email || '',
          phone: res.data.data.user.phone || '',
          street: res.data.data.user.addresses[0]?.street || '',
          barangay: res.data.data.user.addresses[0]?.barangay || '',
          city: res.data.data.user.addresses[0]?.city || '',
          province: res.data.data.user.addresses[0]?.province || '',
          zipCode: res.data.data.user.addresses[0]?.zipCode || '',
          country: res.data.data.user.addresses[0]?.country || 'Philippines',
        });
      } catch (err) {
        setError('Failed to load profile.');
      } finally {
        setLoading(false);
      }
    };
    fetchProfile();
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setSaving(true);
    setSuccess(null);
    setError(null);
    try {
      const profileData = {
        firstName: form.firstName,
        lastName: form.lastName,
        email: form.email,
        phone: form.phone,
        addresses: addresses.map(address => ({
          street: address.street,
          barangay: address.barangay,
          city: address.city,
          province: address.province,
          zipCode: address.zipCode,
          country: address.country
        }))
      };
      await axios.put('/api/auth/profile', profileData);
      setSuccess('Profile updated successfully!');
    } catch (err) {
      setError('Failed to update profile.');
    } finally {
      setSaving(false);
    }
  };

  return (
    <div className="max-w-2xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <h1 className="text-3xl font-bold text-gray-900 mb-6">User Profile</h1>
      {loading ? (
        <div className="text-center py-10">Loading profile...</div>
      ) : error ? (
        <div className="text-center text-red-600 py-10">{error}</div>
      ) : (
        <form onSubmit={handleSubmit} className="bg-white rounded-lg shadow p-6 space-y-6">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">First Name</label>
            <input type="text" name="firstName" value={form.firstName} onChange={handleChange} className="w-full border rounded-lg px-3 py-2" required />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Last Name</label>
            <input type="text" name="lastName" value={form.lastName} onChange={handleChange} className="w-full border rounded-lg px-3 py-2" required />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Email</label>
            <input type="email" name="email" value={form.email} onChange={handleChange} className="w-full border rounded-lg px-3 py-2" required />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Phone</label>
            <input type="text" name="phone" value={form.phone} onChange={handleChange} className="w-full border rounded-lg px-3 py-2" required placeholder="e.g. 09171234567 or +639171234567" pattern="^(\+?63|0)9\d{9}$" />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Street Address</label>
            <input type="text" name="street" value={form.street} onChange={handleChange} className="w-full border rounded-lg px-3 py-2" required placeholder="e.g. Prk. Bougainvilla" />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Barangay</label>
            <input type="text" name="barangay" value={form.barangay} onChange={handleChange} className="w-full border rounded-lg px-3 py-2" required placeholder="e.g. Brgy. Canroma" />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">City/Municipality</label>
            <input type="text" name="city" value={form.city} onChange={handleChange} className="w-full border rounded-lg px-3 py-2" required placeholder="e.g. Pontevedra" />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Province</label>
            <input type="text" name="province" value={form.province} onChange={handleChange} className="w-full border rounded-lg px-3 py-2" required />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">ZIP Code</label>
            <input type="text" name="zipCode" value={form.zipCode} onChange={handleChange} className="w-full border rounded-lg px-3 py-2" required placeholder="e.g. 1600" pattern="^[0-9]{4}$" />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Country</label>
            <input type="text" name="country" value={form.country} onChange={handleChange} className="w-full border rounded-lg px-3 py-2 bg-gray-100" readOnly />
          </div>
          <div className="flex items-center space-x-4">
            <button type="submit" disabled={saving} className="px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors disabled:opacity-50">
              {saving ? 'Saving...' : 'Update Profile'}
            </button>
            {success && <span className="text-green-600 text-sm">{success}</span>}
            {error && <span className="text-red-600 text-sm">{error}</span>}
          </div>
        </form>
      )}
    </div>
  );
};

export default Profile;
